import { StyleSheet, View } from "react-native";

const styles = StyleSheet.create({
  boxTitle: {
    alignItems: "center",
    justifyContent: "center",
    padding: 10,
  },
  textTitle: {
    color: "#FF0046",
    fontSize: 24,
    fontWeight: "bold",
  },
});

export default styles;
